(function(){Application.controller("HomeController",["$scope","$http",function(n,t){n.Manuals=[];t({method:"GET",url:"/Home/GetManuals"}).success(function(t){n.Manuals=t});n.ChangeRating=function(n,i){t({method:"POST",url:"/Home/ChangeRating",data:{manual:n,liked:i}}).success(function(t){n.Rating=t.newRating})}}])}).call(this);